import styled from "styled-components";

export const Transaction = styled.div`
  background-color: black;
  width: 50%;
  color: white;
  padding: 0.5em;
  position: relative;
  bottom: 8em;
  left: 12em;

  .contain {
    display: block;
  }
  .contain .list {
    list-style: none;
    padding-left: 3em;
  }
  .contain .list li {
    display: block;
    text-align: right;
    cursor: pointer;
  }
`;
